import React from 'react'
import { formContainer, Input, Button } from './styles'

function Form({input, setInput, addTodo }) {
  return (
    <formContainer>
        <Input 
        value={input}
        onChange={(e) => setInput(e.target.value)}
        type='text'
        role='input'/>
        <Button type='submit' onClick={(e) => addTodo(e)}> Add a Task </Button>
    </formContainer>
  )
}

export default Form
